import React, { useState } from "react";
import "./App.css";
import SearchLocationInput from "./components/GooglePlcasesApi";
import MapComponent from "./components/Map";
import MapWithOverlay from "./components/MapWithOverlay";
function App() {
  const [selectedLocation, setSelectedLocation] = useState({
    lat: 28.7041,
    lng: 77.1025,
  });
  return (
    <div style={{ height: "100vh", width: "100%" }}>
      <SearchLocationInput setSelectedLocation={setSelectedLocation} />
      <MapComponent selectedLocation={selectedLocation} />
      <MapWithOverlay
        center={{ lat: 21.027591, lng: 105.831982 }}
        zoom={13}
        overlayImage="https://drive.google.com/file/d/1-f86SdvhaxBQwwGOiedRa-ZE4k9W3bWZ/view"
        overlayImageWidth={500}
        overlayImageHeight={300}
      />
    </div>
  );
}

export default App;
